import React from "react"
import './App.css'
import {NavLink} from "react-router-dom"

const Navbar = () =>{
  const yes= JSON.parse(localStorage.getItem("profile")).result.admin;
  return(
    <div style={{display:"flex",width:"100%"}}>

    <NavLink className="nav" exact activeClassName="ac" to="/" style={ yes? {width:"20%"} : {width:"25%"}}>Home</NavLink>
    <NavLink  className="nav" exact activeClassName="ac" to="/about" style={ yes? {width:"20%"} : {width:"25%"}}>About</NavLink>
    <NavLink className="nav" exact activeClassName="ac" to="/stock" style={ yes? {width:"20%"} : {width:"25%"}}>Stock</NavLink>
    <NavLink  className="nav" exact activeClassName="ac" to="/contact" style={ yes? {width:"20%"} : {width:"25%"}}>Contact</NavLink>
    {
   JSON.parse(localStorage.getItem("profile")).result.admin ? 
    <NavLink  className="nav" exact activeClassName="ac" to="/admin" style={ yes? {width:"20%"} : {width:"0%"}}>Dashboard</NavLink>
    :
    <></>
    }
    </div>
  )
}

export default Navbar
